import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div>
      <h1>Welcome to the Zerodha Clone</h1>
      <p>This is a simple React application.</p>
    </div>
  </React.StrictMode>
);
